(23991, 29303, 0, 1, '牧羊人/Shepherd', '', '2010-03-25 00:00:00', 2000, 0, 1, 1, 'Waiting and depending solve noting.\r\n等待與依賴，不能夠解決問題\r\nWhy don’t people introspection themself.\r\n為什麼不想想自己的過錯\r\nAnger, sorrow and destruction.\r\n憤怒、悲傷以及破壞\r\nThey don’t make things up.\r\n也已經於事無補\r\n\r\nThe cross, to me.\r\n這十字架，就我而論\r\nThe world has been nailed on the cross.\r\n世界，已經釘在十字架上\r\nTo the world.\r\n對世界而論\r\nI’ve been nailed on the cross.\r\n我已經釘在十字架上\r\n\r\nI’m a shepherd dying for sheeps.\r\n我是一個牧羊人，為羊而捨命\r\nI believe in my sheep, and they belive in me, too.\r\n我相信我的羊，我的羊也相信我\r\nFollowing me through my voice.\r\n他們聽著我的聲音，跟著我\r\nYou don’t believe in me, because you’re not my sheeps.\r\n你們不會相信，因為你們不是我的羊', '', 224, '', '開睿', '阿能', '鐵皮屋', '', '', 0, 1, 0, '2010-03-25 19:20:32', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
(23992, 29303, 0, 1, '意念/Thought', '', '2010-03-25 00:00:00', 2000, 0, 1, 1, '現在開始 全部給我注意聽\n你們覺得玩音樂 是怎樣的事情\n這很嚴肅 不是逗你開心\n也許看似亮麗卻也過的非常艱辛\n玩音樂 不可能事事都順利\n可能遇到瓶頸 可能自討沒趣\n觀眾都沒有反應 怎麼撐下去\n就快喘不過氣 就快沒有力氣\n\n現在音樂人 很難去生存\n還要善於討好大眾 討好別人\n好像 音樂人就是賤（操你媽的Ｂ）\n好像 音樂人就是壞到骨子裡\n攤開雙手 在老天爺的眼裡\n命運就是那麼 脆弱的東西\n一枚銅幣 掌握在手心\n注意聽 這是鐵皮屋的聲音\n\n風雨過後 時代濁流 總會有\n唯獨這次 讓我去感受（最美的擁有）\n生不逢時 質疑人生 避不過\n事到如今 讓我放手一搏', '', 233, '', '開睿', '阿能', '鐵皮屋', '', '', 0, 0, 0, '2010-03-25 19:24:40', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
