(23995, 11044, 0, 1, '掐理 掐卡掐卡', '2009年的作品\r\n\r\n非營利用~寫好玩的~單純喜歡獨角獸查理這卡通,就sample裡面的音效作成的歌,\r\n\r\n另,中間的吉他取材自X Japan的I.V\r\n\r\n如果喜歡此曲的話,也煩請推薦給你的朋友吧~謝謝\r\n\r\n請加入舞璃的facebook社團,有表演活動/新曲發表 我們將在第一時間通知您~\r\nhttp://www.facebook.com/home.php?sk=lf#!/group.php?gid=149002139284&ref=ts\r\n\r\n舞璃其他的試聽網頁:http://www.myspace.com/crystdancer\r\nor  http://tw.beta.streetvoice.com/music/Crystaldancer/', '2010-03-25 00:00:00', 2009, 0, 2, 3, '', '', 238, '', 'Deth', '', 'Deth', '', '', 0, 1, 0, '2010-03-25 23:29:47', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
