(24000, 21644, 2496, 6, 'What''s Wrong', '再苦、再累，即使滿身是傷痕別忘記身邊的夥伴會用僅存的力量推著你往前進\r\n\r\n龐克復興最終站：使出最後的力量，即使用盡所有力量也別忘記當初堅持的夢想和希望，再苦、再累也要讓龐克復興革命成功！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '這些日子怎麼那麼痛苦  就因為生了一場病 \r\n\r\n全身使不上力氣        我以為我不能再唱歌\r\n\r\n我不想接受這個事實    那是騙人的謊言\r\n\r\n我的身體怎麼了        我的身體到底怎麼了\r\n\r\n\r\n夢想就在前方  我該怎麼去追  WAKE UP MY  FRIEND\r\n\r\n擦乾你的眼淚  就算傷痕累累  Don’t Cry MY  FRIEND\r\n\r\n\r\n難道這是我最後  最後的終點\r\n\r\n而我卻還沒有    沒有達成', '', 209, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:32:01', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
(24001, 21644, 2496, 5, 'Get On Us', '一首描寫台南一個想用自己雙手創造夢想未來的龐克樂團！\r\n\r\n龐克復興第四站：龐克復興漸漸有了起色！各位同胞準備做最後的反擊！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '年華老去已經告訴我　我的時間已經不夠\r\n\r\n不要不要在自甘墮落　我們會推著你向前走\r\n\r\n\r\n相信相信相信就有明天\r\n\r\n好好把握　　眼前所有\r\n\r\n永遠永遠永遠一起承受\r\n\r\n忘掉　過去　重新來過\r\n\r\n\r\n靠一雙手　打破整個天空\r\n\r\n未來 感動 我不會停留\r\n\r\n我的生活　不管你們接不接受\r\n\r\n這條路　我一定　會繼續走', '', 190, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:34:35', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
(24002, 21644, 2496, 4, 'Young Road', '簡單又好唱的青春洋溢夢想的歌曲！\r\n\r\n龐克復興第三站：革命！需要的是希望、夢想、青春、未來永遠不放棄的精神！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '相信唱出未來夢想的明天\r\n\r\n青春年輕陽光勇敢往前衝\r\n\r\n沒有人可以阻止我該往哪走\r\n\r\n下一輩子我要再一次度過\r\n\r\n喔 喔 喔喔喔\r\n\r\n相信相信相信相信 未來的明天\r\n\r\n青春青春青春青春 勇敢往前衝\r\n\r\n沒有阻止我往哪走\r\n\r\n下一輩子我要再一次度過', '', 172, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:37:09', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
