(24004, 21644, 2496, 3, 'Thanks Mother', '就是描寫龐克之母，偉大的母親！沒有了媽媽～我甚麼也不是！全世界的樂團都想上春吶，卻沒有人願意在家幫媽媽洗碗！\r\n\r\n龐克復興第二站：龐克復興大革命的同時千萬別忘記最重要的家人偉大的媽媽！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '這首歌是為媽媽你唱的　　我一定會闖出自己的天空\r\n\r\n為了你我一定會持續努力　做一個成功的乖孩子\r\n\r\n自從你生我的那一刻　       我不會認輸\r\n\r\n就算跌倒我也會自己爬起來    我不會認輸\r\n\r\n\r\n\r\n從小到大　都是你扶養我長大 \r\n\r\n考試考差　從來沒有責怪過我\r\n\r\n直到長大　我才發現\r\n\r\n選擇自己的夢', '', 183, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:44:11', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
(24005, 21644, 2496, 2, 'Sucker', '當年一起玩龐克的夥伴，如今都到哪裡去了？以前為了夢想的堅持，如今只換來一句"沒辦法"，如同窩囊廢般的過得鳥生活！\r\n\r\n龐克復興第一站：號召所有革命烈士，準備揭竿起義！以前衝撞的夥伴們～趕快醒醒吧！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '你是這麼的窩囊你再說你會堅持什麼   (堅持什麼)\r\n\r\n結果正在做這違背理念的事情  (堅持什麼)\r\n\r\n不停的催眠自己 屈就所有\r\n\r\n讓自己困在裡面 懊惱所有\r\n\r\nfucking 看看失魂落魄的自己 \r\n\r\n不配再繼續跟我一起\r\n\r\n當初堅持的不再繼續 我操你媽快醒醒\r\n\r\n\r\n\r\n你是如此的孬小不管如何的反對社會種種  (堅持什麼)\r\n\r\n結果一天到晚把沒辦法掛在嘴邊  (堅持什麼)\r\n\r\n學會了忍受一切 你長大了\r\n\r\n讓自己這麼骯髒 撕裂信念\r\n', '', 181, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:46:37', '2015-03-12 13:42:05', '0000-00-00 00:00:00'),
(24006, 21644, 2496, 1, 'Intro', '充滿EMO味的開頭，描寫著在充滿後搖及金屬的社會龐克力量是如此薄弱！結尾用delay來描述回到龐克全盛時期的時光！', '2010-03-26 00:00:00', 2010, 0, 2, 10, '無', '', 129, '', 'SOD大樂隊', 'SOD大樂隊', 'SOD大樂隊', '無', '', 0, 1, 0, '2010-03-26 10:48:30', '2015-03-12 13:42:06', '0000-00-00 00:00:00'),
(24007, 49013, 0, 1, '棉花糖', '這首歌是為了慶祝和女朋友在一起第三年而製作的\r\n\r\n將我們之間的感覺　用文字　寫在歌曲裡\r\n\r\n我們的愛情 就像棉花糖一樣甜 一直綿密下去\r\n\r\n希望大家會喜歡\r\n\r\n大家的支持就是給我獨立創作繼續做下去的動力 ', '2010-03-24 00:00:00', 2000, 10, 0, 7, '純白色的夢 由我為妳親手 加上七道彩虹的承諾 \r\n\r\n\r\n\r\n輕柔的訴說 在耳邊播送 用雲朵塗滿整個天空 \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n繽紛的氣球 裡頭裝的是我 想讓妳看到的宇宙 \r\n\r\n\r\n\r\n奶油的甜筒 再咬下一口後 是我不敢說的害羞 \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n我牽著妳的手遨遊 這份愛會不會接受 \r\n\r\n\r\n\r\n甜在心的感受 不需要開口 這樣的幸福只有妳懂 \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n我將妳一圈一圈 捲在我手心 排出了雲朵狀\r\n\r\n\r\n\r\n相戀的甜蜜 融化在嘴裡 那幸福的棉花糖\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n我將妳一圈一圈 捧在我手心 捏出愛的形狀\r\n\r\n\r\n\r\n緊緊牽著妳 每一口我愛妳 藏在 幸福的棉花糖\r\n\r\n', '', 282, '', '劉羊羊', '劉羊羊', '劉羊羊', '', '', 0, 1, 1, '2010-03-26 20:28:39', '2013-10-07 17:16:12', '2013-05-10 23:07:00'),
