(24009, 49013, 0, 1, '最愛妮', '慶祝兩年的感情 甜蜜和感動\r\n\r\n每一段愛情都有一個故事 我將我們的故事用歌曲來形容\r\n\r\n如同歌詞裡所形容的\r\n\r\n因為最大的幸福就是"妮"\r\n\r\n我會獨立創作繼續做下去\r\n\r\n希望大家會喜愛這首歌的感覺', '2009-11-18 00:00:00', 2009, 10, 0, 7, '那晚的夜風 讓妳似乎不好受\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n我輕輕的抱著妳 放在我的懷中\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n機車的後座 妳緊緊的抱著我\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n就讓我為妳擋住強風\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一個小小承諾帶著我們走\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n走到用幸福編成的星空\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一年的感情是甜蜜\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n兩年的感情很用心\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n三年之後的我愛妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n說出來一樣讓妳動心\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一年前我等著妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n兩年裡我走向妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n三年之後牽著妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n大聲的說著就是最愛妮\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n(間奏)\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n手中的漩渦 請妳永遠記得我\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n不開心都由我來沒收\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一個小小承諾帶著我們走\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n走到用幸福編成的星空\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一年的感情是甜蜜\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n兩年的感情很用心\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n三年之後的我愛妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n說出來一樣讓妳動心\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n一年前我等著妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n兩年裡我走向妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n三年之後牽著妳\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n大聲的說著就是最愛妮\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n將妳放在我手心\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n讓妳沉浸在愛的幸福裡\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n(END)\r\n\r\n', '', 205, '', '劉羊羊', '劉羊羊', '劉羊羊', '', '', 0, 1, 1, '2010-03-26 20:41:58', '2013-10-07 17:16:12', '2013-05-10 23:06:58'),
